import React from 'react'

function Node(props) {
  return (
    <div>
      {props.value}
      <div className="tree-child">
        {props.left && (
          <Node
            value={props.left.value}
            left={props.left.left}
            right={props.left.right}
          />
              )}
              {props.right && (
          <Node
            value={props.right.value}
            left={props.left.value}
            right={props.right.value}
          />
        )}
      </div>
    </div>
  );
}

export default Node
